txt_content:
 本帖最后由 chyx 于 2018-10-28 15:01 编辑 

有时候对原版模型做更改时可以考虑到继承关系
只修改一点就可以做出很大的效果 而不用一个一个的改。（比如修改block/cube_all就有大量的方块会受影响）
而且同时也要注意 会不会因为无意的修改被继承 使得修改的效果影响不想影响到的东西

这些都需要我们对已有的模型的继承关系有了解
因此做了这个继承关系图


版本是最新的快照帖子
整理的结果如下：文件名后面的竖线之后的字母代表这个文件的内容

d代表display
t代表textures
e代表elements
o代表overrides
如果有这个内容就会有这个字母 没有这个内容就没有这个字母没有继承任何文件的有：

